import React, { useState, useEffect } from 'react';
import Web3 from 'web3';

const App = () => {
  const [address, setAddress] = useState('');
  const [events, setEvents] = useState([]);
  const [error, setError] = useState('');
  const [logs, setLogs] = useState([]);
  const [isFetching, setIsFetching] = useState(false);

  const fetchTransferEvents = async () => {
    if (!address) {
      setError('Please enter a valid contract address.');
      return;
    }

    try {
      setError('');
      setLogs([]);
      setIsFetching(true);
      setLogs((prevLogs) => [...prevLogs, 'Initializing Web3...']);
      const web3 = new Web3('http://37.27.107.225:7777');

      setLogs((prevLogs) => [...prevLogs, `Querying Transfer events for address: ${address}`]);

      // Define the block range
      const latestBlock = await web3.eth.getBlockNumber();
      const fromBlock = 0; // Query from the genesis block
      const toBlock = latestBlock; // Query up to the latest block

      setLogs((prevLogs) => [...prevLogs, `Querying from block ${fromBlock} to ${toBlock}`]);

      const transferEvents = await web3.eth.getPastLogs({
        address,
        topics: [web3.utils.keccak256('Transfer(address,address,uint256)')],
        fromBlock: web3.utils.toHex(fromBlock),
        toBlock: web3.utils.toHex(toBlock),
      });

      if (transferEvents.length === 0) {
        setLogs((prevLogs) => [...prevLogs, 'No events found in the queried block range.']);
        setEvents([]);
      } else {
        const formattedEvents = await Promise.all(
          transferEvents.map(async (event) => {
            const block = await web3.eth.getBlock(event.blockNumber);
            return {
              from: `0x${event.topics[1].slice(26)}`,
              to: `0x${event.topics[2].slice(26)}`,
              value: web3.utils.hexToNumberString(event.data),
              transactionHash: event.transactionHash,
              timestamp: new Date(block.timestamp * 1000).toLocaleString(),
            };
          })
        );

        setEvents(formattedEvents);
        setLogs((prevLogs) => [...prevLogs, `Found ${formattedEvents.length} Transfer events.`]);
      }
    } catch (err) {
      setError(`Error occurred: ${err.message}`);
      setLogs((prevLogs) => [...prevLogs, `Error occurred: ${err.message}`]);
    } finally {
      setIsFetching(false);
    }
  };

  const handleFetchData = () => {
    setEvents([]);
    fetchTransferEvents();
  };

  return (
    <div style={{ padding: '20px', fontFamily: 'Arial, sans-serif' }}>
      <h1>Taraxa Live Chart Debugger</h1>
      <div>
        <input
          type="text"
          value={address}
          onChange={(e) => setAddress(e.target.value)}
          placeholder="Enter Contract Address"
          style={{ width: '400px', marginRight: '10px', padding: '5px' }}
        />
        <button
          onClick={handleFetchData}
          disabled={isFetching}
          style={{ padding: '5px 10px', cursor: isFetching ? 'not-allowed' : 'pointer' }}
        >
          {isFetching ? 'Fetching...' : 'Fetch Data'}
        </button>
      </div>

      {error && <p style={{ color: 'red' }}>{error}</p>}

      <div>
        <h3>Logs:</h3>
        <ul>
          {logs.map((log, index) => (
            <li key={index}>{log}</li>
          ))}
        </ul>
      </div>

      {events.length > 0 && (
        <div>
          <h3>Transfer Events:</h3>
          <table
            style={{
              width: '100%',
              borderCollapse: 'collapse',
              marginTop: '10px',
              fontSize: '14px',
            }}
          >
            <thead>
              <tr>
                <th style={{ border: '1px solid #ddd', padding: '8px' }}>From</th>
                <th style={{ border: '1px solid #ddd', padding: '8px' }}>To</th>
                <th style={{ border: '1px solid #ddd', padding: '8px' }}>Value</th>
                <th style={{ border: '1px solid #ddd', padding: '8px' }}>Transaction Hash</th>
                <th style={{ border: '1px solid #ddd', padding: '8px' }}>Timestamp</th>
              </tr>
            </thead>
            <tbody>
              {events.map((event, index) => (
                <tr key={index}>
                  <td style={{ border: '1px solid #ddd', padding: '8px' }}>{event.from}</td>
                  <td style={{ border: '1px solid #ddd', padding: '8px' }}>{event.to}</td>
                  <td style={{ border: '1px solid #ddd', padding: '8px' }}>{event.value}</td>
                  <td style={{ border: '1px solid #ddd', padding: '8px' }}>{event.transactionHash}</td>
                  <td style={{ border: '1px solid #ddd', padding: '8px' }}>{event.timestamp}</td>
                </tr>
              ))}
            </tbody>
          </table>
        </div>
      )}
    </div>
  );
};

export default App;
